@AllJAmericanB @_IamTrueHate @docKev_ @SilentOrder In the moment I get it.  Frustration, rage, sadness.  George Floyd was the last straw!  And I get it.  
Billy keeps saying the goal is to WIN.  Win, then make changes.
Out of anger the goal became BLM &amp; defund the police.  Both noble and supported by me.  But it lost a lot of ppl

@longbottomsss Loool. Nah. You've just kinda set your mind to what you want to see.

The world is very very large. Twitter is a little section of it.

Don't breed hate because of a couple of things you see on Twitter. Rage, but don't translate it to blind hate. ❤️
